  return (


    <Router>
      <NavBar/>
      <Routes>
          <Route exact path= '/'  />
          <Route path='/about' component={Services} />
          <Route path='/products' component={Products} />
          <Route path='/sign-up' component={SignUp} />
      </Routes>
    </Router>
  );
}

export default App;
